Report only where a Trustee or Director of a Group Entity of the Trustee relationship exists.

This refers to those entities where the trustee is a corporate trustee. This selection will be applicable where there have been transactions between the  entity and directors of an entity that is part of the consolidated group economic entity of which the approved trustee forms a part.  This will include directors of the following group entities:


- Directors of the parent entity(s) of the approved trustee;

- Directors of subsidiaries of the parent entity of the approved trustee;

- Directors of subsidiaries of the approved trustee; 

- Directors of joint ventures or associates of the approved trustee; and

- Directors of other entities in the trustee's group
